sys_variable_value.value:
(function execute(inputs, outputs) {
// ... code ...
var obj = {}; //JSON object
var pairs = inputs.str.split(","); //multiple key value pairs are divided by "," so splitting them to divide the key value pairs.
for (var i = 0; i < pairs.length; i++) {
    var keyVal = pairs[i].split(":"); //splitting the keys from values to form JSON Pairs below
	//gs.print(keyVal);
    if (keyVal.length === 2) {
        var key = keyVal[0];
        var value = keyVal[1];
        obj[key] = value;
    }
}
outputs.obj1=obj;
})(inputs, outputs);

